import React from 'react'
import Sidebar from './Sidebar.js'
import SlideShow from './Slideshow.js'

class MainContent extends React.Component {
  constructor() {
    super()
  }

  render() {
    return (
        <div className='row'>
          <div className='column-1'>
            <Sidebar />
          </div>
          <div class='column'>
            <div class='content'>
              <SlideShow />
            </div>
          </div>
        </div>
    )
  }
}

export default MainContent
